import{login}from"../../services/auth.service.js";const loginForm=document.getElementById("login-form"),loginFormButton=document.getElementById("login-form-button");loginFormButton.addEventListener("click",o=>{o.preventDefault();var o=document.getElementById("user-email"),e=document.getElementById("user-password"),o={email:null==o?void 0:o.value,password:null==e?void 0:e.value};login("/login",o).then(o=>{localStorage.setItem("token",null==o?void 0:o.token),loginForm.submit()}).catch(o=>{console.error("Error login "+o),loginForm.submit()})});